import 'react-native-get-random-values'
import React from "react";
import { View, SafeAreaView } from "react-native";
import { StreamChat } from "stream-chat";
import {
  Chat,
  Channel,
  MessageList,
  MessageInput,
} from "stream-chat-expo";

const chatClient = new StreamChat('f8wwud5et5jd');
const userToken =
    'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoic3RlZXAtcGFwZXItNiJ9.0KnN1gg7rpcgmWaLwxCJ2efflJrlkmTBoPJIcxeux_A';

const user = {
  id: 'steep-paper-6',
  name: 'Steep paper',
  image:
      'https://getstream.io/random_png/?id=steep-paper-6&amp;name=Steep+paper',
};

chatClient.setUser(user, userToken);

class ChannelScreen extends React.Component {
  render() {
    const channel = chatClient.channel("messaging", "steep-paper-6");
    channel.watch();

    return (
        <SafeAreaView>
          <Chat client={chatClient}>
            <Channel channel={channel}>
              <View style={{ display: "flex", height: "100%" }}>
                <MessageList />
                <MessageInput />
              </View>
            </Channel>
          </Chat>
        </SafeAreaView>
    );
  }
}

export default class App extends React.Component {
  render() {
    return <ChannelScreen />;
  }
}
